  public function main ()
  {
    $this->target_url = array ();
    $this->init ();
    foreach ($this->target_url as $url)
    {
      $this->doPing ($url);
      //sleep (1);
    }
  }

  function doPing ($url)
  {
    $this->log ($url, LOG_DEBUG);

    //open connection
    $ch = curl_init ();

    //set the url, number of POST vars, POST data
    $options = array(
      CURLOPT_URL            => $url,
      CURLOPT_RETURNTRANSFER => true,
      CURLOPT_HEADER         => true,
      CURLOPT_FOLLOWLOCATION => true,
      CURLOPT_ENCODING       => "",
      CURLOPT_AUTOREFERER    => true,
      CURLOPT_CONNECTTIMEOUT => 120,
      CURLOPT_TIMEOUT        => 5,
      CURLOPT_MAXREDIRS      => 10,
      );

    curl_setopt_array($ch, $options);
    $response = curl_exec ($ch);
    $httpCode = curl_getinfo ($ch, CURLINFO_HTTP_CODE);

    $info = curl_getinfo ($ch);
    curl_close ($ch);

    //$this->log ($info, LOG_DEBUG);
    if ($info{'http_code'} == 301 || $info{'http_code'} == 302)
    {
      $this->log ($info{'url'}, LOG_DEBUG);

      if (!(preg_match ("market\:\/\/details\?id\=", $info{'url'})))
      {
        $this->log ("aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa", LOG_DEBUG);
      }

      if (!(preg_match ("itms-appss\:\/\/itunes", $info{'url'})))
      {
        $this->log ("bbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbb", LOG_DEBUG);
      }
    }

    if ($info{'http_code'} != 200)
    {
      return $info{'http_code'};
    }
  }

